export default class TitleBar extends React.Component {

    render() {
        return(
            <div className='title-bar'>
                <img src="data:image/svg+xml;base64,"/>
                <h1>Klaus</h1>
                <br/>
                <p>Keeps bets simple</p>
            </div>
        )
    }
}
